import Link from 'next/link';
import Form from '../components/Form';


export default function Index() {
    return (
        <div>
            <main className="main">
                <link href="https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,600;1,700&display=swap" rel="stylesheet"></link>
                <h1>GLOBAL U MASK OPPERATION</h1>
                <link href="https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,300;0,600;1,700&display=swap" rel="stylesheet"></link>
                <p>Global U is a missions team of entrepreneurs who strive to come together to solve the world’s most pressing problems.</p>
                <p>Right now, there is a huge problem of mask shortages for essential employees who deal closely with the public everyday. These people fight to keep our world running as smoothly as possible - we couldn’t do life as we know it without them!</p>
                <p>We are reaching out to serve and love those around us by creating and distributing cloth masks to keep those people safe!</p>


                1 Corinthians 12:20 states,
                "As it is, there are many parts, but one body."
            We can work together to unify our community and do some social good!

                <Link href="/about">
                    <a title="About Page">About Page</a>
                </Link>
                <Link href="/Donations">
                    <a title="Donations">Donations</a>
                </Link>
                <p>Welcome</p>
                <Form />

                <style jsx>{`
        h1,
        a {
          font-family: 'Poppins';
          font-style: italic;
        }

        ul {
          padding: 0;
        }

        li {
          list-style: none;
          margin: 5px 0;
        }

        a {
          text-decoration: none;
        }

        a:hover {
          opacity: 0.6;
        }

        .paragraph {
            color: ;
        }
        .main {
            background-color: #ede1d0;
        }
      `}</style>
            </main>
        </div>


    );
}
